class Solution {
    fun minimumBeautifulSubstrings(s: String): Int {
        fun isPowerOfFive(n: Int): Boolean {
            var num = n
            while (num > 1 && num % 5 == 0) num /= 5
            return num == 1
        }

        val dp = IntArray(s.length + 1) { Int.MAX_VALUE }
        dp[0] = 0
        for (i in 1..s.length) {
            if (s[i - 1] == '0') continue
            var num = 0
            for (j in i downTo 1) {
                num = num or (1 shl (i - j))
                if (isPowerOfFive(num)) {
                    dp[i] = minOf(dp[i], dp[j - 1] + 1)
                }
            }
        }

        return if (dp[s.length] == Int.MAX_VALUE) -1 else dp[s.length]
    }
}
